import React, {use} from "react";
import { ModalCustom } from "./styled";
import { CloseBut } from "modules/ModalMember/styled";
import ButtonMember from "modules/ButtonMember";
import { LinkCustom } from "modules/FooterMember/styled";
import { useParams } from "react-router-dom";

const PositionTab = () => {
  const {name} = useParams()
  const [modalShow, setModalShow] = React.useState(false);

  const MyVerticallyCenteredModal = (props) => {
    return (
      <ModalCustom
        closeButton
        {...props}
        size="lg"
        aria-labelledby="contained-modal-title-vcenter"
        centered
      >
        <CloseBut closeButton>
          <div>
            <div>
              <LinkCustom to="/MemberLibrary/President">President</LinkCustom>
            </div>
            <div>
              <LinkCustom to="/MemberLibrary/Vice President">
                Vice President
              </LinkCustom>
            </div>
            <div>
              <LinkCustom to="/MemberLibrary/President">
                Secretary General
              </LinkCustom>
            </div>
            <div>
              <LinkCustom to="/MemberLibrary/President">
                Deputy Secretary General
              </LinkCustom>
            </div>
            <div>
              <LinkCustom to="/MemberLibrary/President">
                Assistant Secretary General
              </LinkCustom>
            </div>
            <div>
              <LinkCustom to="/MemberLibrary/President">
                Senior Executive Director
              </LinkCustom>
            </div>
            <div>
              <LinkCustom to="/MemberLibrary/President">
                Chief Executive Director
              </LinkCustom>
            </div>
            <div>
              <LinkCustom to="/MemberLibrary/President">
                Deputy Chief Executive Director
              </LinkCustom>
            </div>
          </div>
        </CloseBut>
      </ModalCustom>
    );
  };

  return (
    <div>
      <div onClick={() => setModalShow(true)}>
        <ButtonMember name={name} />
      </div>

      <MyVerticallyCenteredModal
        show={modalShow}
        onHide={() => setModalShow(false)}
      />
    </div>
  );
};

export default PositionTab;
